import React, { useState, Component } from "react";


const Portfolio = () => {
    return (
        <div>
            <h1 className="mt-4 text-center portfolio-main-heading">Have a Look at What We Do</h1>
            <h4>Have a Look at What We Do
                Our team consists of individuals of multidisciplinary talents. We were born to build inspiring and influential brands that deliver memorable and transformative digital experiences.</h4>
        </div>
    )
}

export default Portfolio;
